<script>

function buscarAluno() {

    var cpf = $("#txtCpfAluno").val();

    if (String($("#txtCpfAluno").val()).length == 11) {

        $.ajax({
            url: 'api.php',
            type: 'POST',
            dataType: 'json',
            data: {
                procurar_cliente_cpf: true,
                cpf: cpf
            },
            success: function(r) {
                if (r != null) {
                    $("#txtNomeAluno").val(r[0].NOME_RAZAO);
                    $("#txtDataNascimento").val(r[0].DATA_NASCIMENTO);
                    $("#txtEndereco").val(r[0].ENDERECO);
                    $("#txtNumero").val(r[0].NUMERO);
                    $("#txtBairro").val(r[0].BAIRRO);
                    $("#txtCidade").val(r[0].CIDADE);
                    $("#txtFone").val(r[0].TELEFONE1);
                    $("#txtEmail").val(r[0].EMAIL);
                    $("#txtCodCadastroExistente").val(r[0].CLIENTES_ID);
                } else {
                    $("#txtNomeAluno").val("");
                    $("#txtDataNascimento").val("");
                    $("#txtEndereco").val("");
                    $("#txtNumero").val("");
                    $("#txtBairro").val("");
                    $("#txtCidade").val("");
                    $("#txtFone").val("");
                    $("#txtEmail").val("");
                    $("#txtCodCadastroExistente").val("0");
                }
            }
        });

    } else {
        $("#txtNomeAluno").val("");
        $("#txtDataNascimento").val("");
        $("#txtEndereco").val("");
        $("#txtNumero").val("");
        $("#txtBairro").val("");
        $("#txtCidade").val("");
        $("#txtFone").val("");
        $("#txtEmail").val("");
        $("#txtCodCadastroExistente").val("0");
    }
}




    $("#btEnviar").click(function(e){
        e.preventDefault();

        //buscarAluno();
        
        console.log("enviando...");

